import React, {useEffect, useState} from 'react';
import axios from 'axios';
import './Home/home.css';
import { Route, withRouter, Link, Switch, useHistory } from "react-router-dom";

function ViewFriend(props){

    function ListContainer(props) {

        if (props.state != undefined && props.state.currentListItems != undefined){
        var listItemState = '';
        if (props.state.currentState === 0) {
            listItemState = "Bucket List";
        }
        else {
            listItemState = "Todo List";
        }
        if (props.state.currentListItems.length > 0) {
            return (
                props.state.currentListItems.map((item, index) => {
                    return (
                        <div class="list-item-Home">
                            <div class="type">
                                {listItemState}
                            </div>
                            <div class="listTitle">
                                {item.itemTitle}
                            </div>
                            <div class="listBody">
                                {item.caption}
                            </div>
                        </div>
                    ) 
                })
            )
        }
      }
        return (
            <>
            </>
        )
    }

    console.log(props.location.state.bucketList);
    //main return
    return(
        <div>
            <span>{}</span>
            <ListContainer state={props}/>
        </div>
    )
}

export default withRouter(ViewFriend);
